import styles from './MealItem.module.css';

const MealItem = ({ meal }) => {
    return (<li className={styles.meal}>
        <h3>{meal.name}</h3>
        <div className={styles.description}>{meal.description}</div>
        <div className={styles.price}>{meal.price}</div>
    </li >)
}

export default MealItem;
